import React, { useState } from 'react';
import './App.css';

function App() {
  const [currentView, setCurrentView] = useState('home');

  // Certification data with detailed information
  const certifications = {
    cissp: {
      name: 'CISSP',
      fullName: 'Certified Information Systems Security Professional',
      description: 'Advanced cybersecurity certification covering security and risk management, asset security, security architecture, and more.',
      icon: '🛡️',
      issuer: '(ISC)²',
      link: 'https://www.isc2.org/Certifications/CISSP'
    },
    oscp: {
      name: 'OSCP',
      fullName: 'Offensive Security Certified Professional',
      description: 'Hands-on penetration testing certification requiring practical exploitation skills and report writing.',
      icon: '⚔️',
      issuer: 'Offensive Security',
      link: 'https://www.offensive-security.com/pwk-oscp/'
    },
    aws: {
      name: 'AWS SAA',
      fullName: 'AWS Solutions Architect Associate',
      description: 'Validates expertise in designing distributed systems and applications on AWS cloud platform.',
      icon: '☁️',
      issuer: 'Amazon Web Services',
      link: 'https://aws.amazon.com/certification/certified-solutions-architect-associate/'
    },
    gcp: {
      name: 'GCP ACE',
      fullName: 'Google Cloud Associate Cloud Engineer',
      description: 'Demonstrates ability to deploy applications, monitor operations, and maintain cloud projects on GCP.',
      icon: '🌐',
      issuer: 'Google Cloud',
      link: 'https://cloud.google.com/certification/cloud-engineer'
    },
    sans: {
      name: 'SANS GPYC',
      fullName: 'GIAC Python Coder',
      description: 'Validates skills in Python programming for cybersecurity professionals and penetration testing.',
      icon: '🐍',
      issuer: 'SANS Institute',
      link: 'https://www.giac.org/certification/python-coder-gpyc'
    }
  };

  // Professional experience data
  const professionalExperience = {
    blackbreach: {
      title: 'Chief Technology Officer',
      company: 'Black Breach',
      description: 'Spearheading cybersecurity innovation and development, implementing comprehensive security frameworks across various industries. Leading automated penetration testing solutions and cloud security initiatives.',
      period: 'Current',
      icon: '👔'
    },
    coalfire: {
      title: 'Penetration Tester & Security Consultant',
      company: 'Coalfire Labs',
      description: 'Specialized in enterprise environment testing, web application and API security assessments. Conducted comprehensive security evaluations for Fortune 500 companies.',
      period: '2018-2019',
      icon: '🛡️'
    },
    dell: {
      title: 'Information Security & Systems Administrator',
      company: 'Dell Inc.',
      description: 'Managed enterprise IT infrastructure and security operations. Implemented security policies and maintained critical systems for large-scale corporate environments.',
      period: '2016-2018',
      icon: '💻'
    }
  };

  // Security research data
  const securityResearch = {
    slurp: {
      title: 'AWS S3 Bucket Enumeration Research',
      description: 'Developed sophisticated S3 bucket discovery techniques through permutation attacks and DNS resolution methods.',
      link: 'https://github.com/bbb31/slurp',
      impact: 'Widely adopted tool in security community',
      icon: '🔍'
    }
  };

  // Speaking engagements data
  const speakingEngagements = {
    blackhat: {
      title: 'Black Hat USA 2019 Speaker',
      description: 'Presented advanced penetration testing techniques and enterprise security assessment methodologies at the world\'s most prestigious cybersecurity conference.',
      period: '2019',
      icon: '🎤'
    },
    defcon: {
      title: 'DEF CON Workshop Instructor',
      description: 'Conducted hands-on Payment Village workshops focusing on magstripe security and payment system vulnerabilities. Led 3-hour intensive training sessions.',
      period: '2019-2021',
      icon: '🏴‍☠️'
    },
    nullcon: {
      title: 'NULLCON Payment Village Trainer',
      description: 'Delivered specialized training on offensive payment security, teaching advanced techniques for payment system penetration testing.',
      period: '2019',
      icon: '💳'
    }
  };

  // Entrepreneurship data
  const entrepreneurship = {
    sugar: {
      title: 'Sugar Security',
      description: 'Founded and developed comprehensive vulnerability scanning platform, successfully acquired by Black Breach as part of CTO transition.',
      outcome: 'Acquired',
      icon: '🚀'
    }
  };

  // Technical expertise and stack
  const techStack = {
    fullstack: {
      title: 'Full-Stack Engineering',
      description: 'Expert-level Python and JavaScript development with modern frameworks and libraries. Building scalable applications from backend APIs to responsive frontends.',
      technologies: 'Python, JavaScript, React, Node.js, FastAPI, Django',
      icon: '⚡'
    },
    cloud: {
      title: 'AWS Serverless Architecture',
      description: 'Certified architect designing and implementing serverless solutions. Lambda functions, API Gateway, DynamoDB, S3, CloudFormation, and infrastructure as code.',
      technologies: 'Lambda, API Gateway, DynamoDB, CloudFormation, CDK',
      icon: '☁️'
    },
